import React from 'react';
import '../index.css';
import { lvl1, lvl2, lvl3 } from '../images';

function Success(){
    const [poitactive, setPointActive] = React.useState(0);
    const pointItems = [0, 1 , 2];
    const sucImg = [lvl1, lvl2, lvl3];
    const onPointChange = (index) =>{
        setPointActive(index);
    }
    return(
        <div className='successcontainer'>

            <div className='point_container'>
                {pointItems.map( (item, index) => (
                    <div 
                        onClick={() => onPointChange(index)} 
                        className={poitactive == index ? 'point_active' : 'point_disable'} 
                        key={`${item}_${index}`}>
                    </div>
                ))
                }
                
            </div>
        </div >
        );
}


export default Success;
